import MyPosts from "./Pages/MyPosts";
import MyNavbar from "./Componets/UI/navbars/MyNavbar";
import MyError from "./Pages/MyError";
import AppRouter from "./Componets/AppRouter";

function App() {
  return (
    <BrowserRouter>
      <MyNavbar />
      <AppRouter />
    </BrowserRouter>
  )
}

export default App;
